import React, { Component } from "react";

export default class AdminPage extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <ul className="list-group">
          {this.props.allItems.map((item) => {
            return <li className="list-group-item">{item.title}</li>;
            
          })}
        </ul>
      </div>
    );
  }
}
